                    <Icon><InstagramIcon></InstagramIcon></Icon>
                    <Icon><TwitterIcon></TwitterIcon></Icon>
                    <Icon><FacebookIcon></FacebookIcon></Icon>
                    <Icon><LinkedInIcon></LinkedInIcon></Icon>
                </IconContainer>
            </Left>
            <Center>vsdav</Center>
            <Right>vdv</Right>
        </Container>
    )
}
